import React from 'react';

const Navbar = () => {
  return (
    <nav>
      <div className="navbar-container">
        <h1>Digital Docker</h1>
        <ul>
          <li><a href="#home">Home</a></li>
          <li><a href="#features">Features</a></li>
          <li><a href="#contact">Contact</a></li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
